import styled from "styled-components";

const LoginComp = styled.div`
  height: calc(100vh - 140px);
  width: 100%;
  margin-top: 140px;
  .login_inner {
    width: 700px;
    background-color: aliceblue;
    height: 100%;
    margin: 0 auto;
    .login_container {
      padding-top: 150px;
      h2 {
        text-align: center;
        margin: 20px 0;
      }
      table {
        width: 500px;
        margin: 0 auto;
        tr {
          height: 50px;
          input {
            height: 35px;
            width: 100%;
          }
        }
      }
    }
  }
`;
export default LoginComp;
